import { BrowserRouter as Router, Routes } from 'react-router-dom';
import Home from './Components/Home';
import Shop from './Components/Shop';
import Regester from './Components/Register';

function App() {
  return (
    <Router>

      <Home />
      <Shop />
      <Regester />
    </Router>

  );
}

export default App;
